import './App.css';
import UserComponent from './components/UserComponent';
import AddUser from './components/AddUser';
import UserCount from './components/UserCount';

function App() {
  return (
    <div className="App">
      <AddUser/>
      <UserCount/>
      <UserComponent/>
    </div>
  );
}

export default App;
